import { useState } from "react";

function Row(props) {
  const [rows, setRows] = useState();

  const data = [];
  for (let i = 0; i < props.length; i++) {
    if (props[i]) data.push(<td>{props[i]}</td>);
  }

  return (
    <tr>
      {rows.map((row) => (
        <td key={row.id}>{row.id}</td>
      ))}
    </tr>
  );
}

